import React from "react";
import Button from "../ui/button";
import logo from "../../data/Validate.png";

function Nav() {
  return (
    <>
      <div className="Navbar w-screen flex justify-items-center content-items-center">
        <img src={logo} alt="validate_logo" />
        <Button text="Tasks" url="/task" />
        <Button text="Habits" url="habit" />
      </div>
    </>
  );
}

export default Nav;
